-- Dump completed on 2020-11-08 10:36:39


use termprojekt;

/*  1)	How many total deaths were there in 2020 until the day? */

select sum(number_of_persons_killed) as total_killed 
from motorcrashes
where crash_date between '2019-12-31'and '2020-12-31';

/*Are there more pedestrian, cyclist or motorist injuries? */

select sum(number_of_pedestrians_injured), sum(number_of_cyclist_injured), sum(number_of_motorist_injured)
from motorcrashes;

select sum(number_of_pedestrians_killed), sum(number_of_cyclist_killed), sum(number_of_motorist_killed)
from motorcrashes; 

select 
sum(number_of_pedestrians_injured)/sum(number_of_pedestrians_killed) as death_ratio_pedestrians,
sum(number_of_cyclist_injured)/sum(number_of_cyclist_killed) as death_ratio_cyclist,
sum(number_of_motorist_injured)/sum(number_of_motorist_killed) as death_ratio_motorist
from motorcrashes;

/* Is there pattern in crash time? Morning, afternoon, night? */


select sum(number_of_persons_injured),
Case
when crash_time between '06:00:00' and '12:00:00' then 'Morning'
when crash_time between '12:00:00' and '20:00:00' then 'Afternoon' 
Else 'Night' 
END 
as period_of_day
from motorcrashes
group by period_of_day;

/* injured done, look at the killed*/

select sum(number_of_persons_killed) as total_killed,
Case
when crash_time between '06:00:00' and '12:00:00' then 'Morning'
when crash_time between '12:00:00' and '20:00:00' then 'Afternoon' 
Else 'Night' 
END 
as period_of_day
from motorcrashes
group by period_of_day;


/* Which borough had the biggest number accidents? Which had the least accidents?*/


select count(borough), borough
from motorcrashes
where borough not like ''
group by borough;


/*Is there a street that is particularly prone to accidents? Or a junction (cross-street)? */

select count(on_street_name), on_street_name 
from streets
left join motorcrashes
on streets.collision_id=motorcrashes.collision_id
where on_street_name not like ''
group by on_street_name
order by count(on_street_name) desc
limit 10;


select count(cross_street_name), cross_street_name as junction
from streets
left join motorcrashes
on streets.collision_id=motorcrashes.collision_id
where cross_street_name not like ''
group by cross_street_name
order by count(cross_street_name) desc
limit 10;



/* What was the main contributing factor for the injuries or deaths? */ 

select sum(number_of_persons_injured), sum(number_of_persons_killed), count(contributing_factor_vehicle1), contributing_factor_vehicle1
from motorcrashes
inner join factors
on factors.collision_id=motorcrashes.collision_id
where number_of_persons_injured >0 or number_of_persons_killed != 0
group by contributing_factor_vehicle1 
having contributing_factor_vehicle1 not like ''
order by count(contributing_factor_vehicle1) desc;


/* How many accidents happened under the influence of alcohol? */ 

/* a view is created for this query, to speed the search up */ 

DROP VIEW IF EXISTS alcohol_influenced_accidents;

create view alcohol_influenced_accidents as
select sum(number_of_persons_injured), sum(number_of_persons_killed), count(contributing_factor_vehicle1), contributing_factor_vehicle1
from motorcrashes
inner join factors
on factors.collision_id=motorcrashes.collision_id
group by contributing_factor_vehicle1 
having contributing_factor_vehicle1 like '%alcohol%'
order by count(contributing_factor_vehicle1) desc;

select * from alcohol_influenced_accidents;

/* Stored Procedure: Is there a vehicle type that causes more accidents than the other?  */ 

DROP PROCEDURE IF EXISTS accidents_by_vehicle_type;

DELIMITER //

CREATE PROCEDURE accidents_by_vehicle_type(
In kocsibemegy Varchar(45)
)
BEGIN
Select  *
from motorcrashes
where vehicle_type like kocsibemegy;
END //

DELIMITER ;

call accidents_by_vehicle_type('sedan');

/* This is nice, but it ignores other types of sedan from the database like: Sedan + 2 dr sedan, 4dr sedan 

->	call accidents_by_vehicle_type('sedan%'); -> solves the problem, but it could cause problems if you forget % */

DROP PROCEDURE IF EXISTS accidents_by_vehicle_type;

DELIMITER //

CREATE PROCEDURE accidents_by_vehicle_type(
In kocsibemegy Varchar(45)
)
BEGIN
Select  *
from motorcrashes
where vehicle_type like concat('%',kocsibemegy, '%');
END //

DELIMITER ;

call accidents_by_vehicle_type('sedan');

call accidents_by_vehicle_type('truck');

/* Trigger -> if a new accident happens? */ 

drop table log;
create table log
(id integer not null auto_increment,
message varchar(39), 
log_date DATE,
PRIMARY KEY (id)
);


/* Create procedure: accidents_by_vehicle_typ */

DROP PROCEDURE IF EXISTS accidents_by_vehicle_type;
DELIMITER //
CREATE PROCEDURE accidents_by_vehicle_type(
	In kocsibemegy Varchar(45)
)
BEGIN
	Select *
	from motorcrashes
	where vehicle_type like kocsibemegy;
END //
DELIMITER ;

/* Trigger -> if a new accident happens?  */

DROP TRIGGER IF EXISTS logger_trigger;

CREATE TRIGGER logger_trigger
    AFTER insert
    ON motorcrashes FOR EACH ROW
		insert into log(message, log_date) values ("motorcrashes insertion", now());
        

